import React from "react";

const Avatar = ({image,scale}) => {
    return (
        <div className="h-[10px] w-[10px] rounded-full">
            <img src = {image} className = "w-full h-full rounded-full" alt = "avatar"/>
        </div>
    );
}

export default Avatar;
